import "./Autok.css";
import React from "react";

class Autok extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        autok: []
      };
    }
  
    componentDidMount() {
      fetch("http://localhost:5000/api/auto/autok")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              autok: result
            });
          },
          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }
  
    render() {
      const { error, isLoaded, autok } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        
        return (
          <div className="pageautok">
            <ul>
              {autok.map(auto => (
              <li id="auto" key={auto._id}>
               <img src={auto.kep} alt={auto.kep} /><br />
               <label>Marka: {auto.marka}</label><br />
               <label>Uzemanyag: {auto.elektromos}</label><br />
               <label>√Åra: {auto.ar}</label>   <br />
               <input type="text" id="szemelyi" /> <br />
               <button>Rendeles</button>
              </li>
           ))}
          </ul>
          </div>
          
        ); 
      }
    }
  }
export default Autok;
